import React from "react";

export default function SkillList(props){
    const handleChange=(e)=>{
        console.log(e.target.innerHTML);
    }

    const x = props.skills.map(x=>
        <li><button onClick={handleChange}>{x.value}</button></li>
    );
    return(
        <>
            <ul>
                {x}
            </ul>
        </>
    );
}
